CREATE TABLE CUSTOMER (
 CUSTID              INT (6) NOT NULL,
 NAME                varchar(45),
 ADDRESS             varchar(40),
 CITY                varchar(30),
 STATE               varchar(2),
 ZIP                 varchar(9),
